import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";

const Header = ({props}) => {
  return (
    <div className="header">
      <img
        className="header__image"
        src="https://img.icons8.com/ios-glyphs/2x/men-age-group-5.png"
        alt=""
      />

      <ul>
        <Link to="/about">
          <li>About</li>
        </Link>

        <Link to="/projects">
          <li>Projects</li>
        </Link>

        <Link to="/resume">
          <li>Resume</li>
        </Link>
      </ul>
    </div>
  );
};

export default Header;
